import React from "react";
import { Link, NavLink } from "react-router-dom";
const Menu = () => {
  return (
    <>
      <NavLink to='/'> AboutUs </NavLink>
      <NavLinkLink to='/contact'> ContactUs </NavLinkLink>
      <br />
      <a href="/"> AboutUs</a>
      <a href="/contact"> ContactUs </a>
    </>
  );
};

export default Menu;
